import { useEffect, useState } from "react";

interface IUser {
  id: number,
  name: string,
  username: string,
}

function App() {
  const [users, setUsers] = useState<IUser[] | null>(null);

  return (
    <>
      <div className="block">
        {users
          &&
          <ul>
            {users.map(({ id, name, username }) => {
              return <li key={id}>Name: {name}, Username: {username}</li>
            })}
          </ul>
        }
      </div>
    </>
  );
}

export default App;
